import React, { Component } from "react";


class Card extends Component{
    constructor(props){
        super(props);
        this.state={
            id:1,
        }
    }
    render(){
        return (
            <div>
                <h2>{this.props.movies.title}</h2>
                <img id={this.props.movies.id} src={"http://image.tmdb.org/t/p/w200/"+ this.props.movies.poster_path} />
                <button></button>
            </div>
        )
    }
}
export default Card;
